import React from 'react';
import './portfolio.css';
import Projects from './projects';
import {Link, BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Achievement from './Achievement';
import Workshop from './workshop';
import Certificates from './certificate';

function Portfolio() {
    return (
        <>
        <div>
        <div  className="main-container-Wrapper-About-Portfolio">
        <p className="portfolio-page-heading-Para">Portfolio</p>
        <div className="horizontal-Line-portfolio"></div>
        <p className="portfolio-page-Quote-Para">Skills & Experiences </p>  
        </div>
<div className="head-name-under-portfolio">
    <p className="portfolio-heads-hyperlinks"> <a href="/">All</a><span>|</span></p>
    <p className="portfolio-heads-hyperlinks"><Link to="/projects">Projects</Link><span>|</span></p>
    <p className="portfolio-heads-hyperlinks"> <a href="/">Achievements</a><span>|</span></p>
    <p className="portfolio-heads-hyperlinks"><a href="/">Workshops</a><span>|</span></p>
    <p className="portfolio-heads-hyperlinks"> <a href="/">Certification</a></p> 
</div>

<Router>

 <Route exact path="/projects">   <Projects/></Route>

</Router>
{/* 
<Achievement/>
<Workshop/>
<Certificates/> */}

        <div className="pageEnd-horizontal-Line-portfolio"></div>
        </div>
        </>
    )
}

export default Portfolio;
